import React from "react";
import ReactDOM from "react-dom/client";
import { useState } from "react";
import Axios from "axios";
import { Link, Navigate, useNavigate } from "react-router-dom";

function process_query()
{
  async () => {
    await fetch("http://localhost:8080/query", {
      method: "POST",
      headers: {
        Accept: "application/json",
        "Content-Type": "application/json",
        withCredentials: true,
        crossorigin: true,
        mode: "no-cors",
      },
      body: query,
    });
    setTimeout(() => {
      navigate("/resultsPage");
    }, 1000);
  }
}


function SearchPage() {
  const [query, setQuery] = useState();
  const [themeVar, setThemeVar] = useState("light");
  const navigate = useNavigate();
  let theme = "light";

  const sun = "https://www.uplooder.net/img/image/55/7aa9993fc291bc170abea048589896cf/sun.svg";
  const moon = "https://www.uplooder.net/img/image/2/addf703a24a12d030968858e0879b11e/moon.svg";

  function setTheme(container) {
    let themeIcon = container.target.getElementByClassName("theme-icon")[0];;
    switch (theme) {
      case "dark":
        setLight(container.target,themeIcon);
        theme = "light";
        break;
      case "light":
        setDark(container.target,themeIcon);
        theme = "dark";
        break;
    }
  }
  function setLight(container,themeIcon) {
    root.style.setProperty(
      "--bs-dark",
      "linear-gradient(318.32deg, #c3d1e4 0%, #dde7f3 55%, #d4e0ed 100%)"
    );
    container.classList.remove("shadow-dark");
    setTimeout(() => {
      container.classList.add("shadow-light");
      themeIcon.classList.remove("change");
    }, 300);
    themeIcon.classList.add("change");
    themeIcon.src = sun;
  }
  function setDark(container,themeIcon) {
    console.log("container = " + container +", themeIcon = " + themeIcon);
    root.style.setProperty("--bs-dark", "#212529");
    container.classList.remove("shadow-light");
    setTimeout(() => {
      container.classList.add("shadow-dark");
      themeIcon.classList.remove("change");
    }, 300);
    themeIcon.classList.add("change");
    themeIcon.src = moon;
  }

  return (

    <div className = { "cover " + theme}>

    <div class="theme-container shadow-dark" onClick={(e)=>setTheme(e)}>
      <img id="theme-icon" key={"theme-icon"} src={"https://www.uplooder.net/img/image/2/addf703a24a12d030968858e0879b11e/moon.svg"} alt={"ERR"} />
    </div>

    <div class="container-fluid centered">
      <div class="row">
        
      { 
        theme == "light" ?
        
        <h1 class="SEName-light col-12">
          <span class="GBlue">D</span>
          <span class="GRed">o</span>
          <span class="GYellow">o</span>
          <span class="GBlue">d</span>
          <span class="GGreen">l</span>
          <span class="GRed">e</span>
        </h1>
        :
        <h1 class="SEName-dark col-12">
          D
          o
          o
          d
          l
          e        
        </h1>
      }
        <div class="col-12">
          <div class="input-group mb-3 mt-5 mb-5" style = {{width : 60 + '%', margin : "auto"}}>
            <input
              type="text"
              class={theme == "dark" ? "form-control searchField-dark": "form-control"}
              id="searchField"
              placeholder="Search Doodle or type a URL"
              onChange = {(e) => {setQuery(e.target.value)}}
            />
          </div>
        </div>

        <div class="col-12 mt-1">

          <div class="container">
            <div class="row justify-content-center">
              <div class="col-2"><button id="find" class={"btn" + (theme == "dark" ? " btn-dark" :"")} onClick={console.log(query)}>Doodle Search</button></div>
              <div class="col-2"><button class={(theme == "dark" ? "btn btn-dark" :"btn")}>i'm feeling lucky</button></div>
            </div>
          </div>

        </div>
      </div>
    </div>
    </div>

/*
    <div>
      <input
        type="text"
        onChange={(e) => {
          setQuery(e.target.value);
        }}
      ></input>
      <button
        onClick={process_query()}
      >
        search
      </button>
    </div>
*/
  );
}


export default SearchPage;
